import React from 'react';

export const TodoList: React.FC = () => {
    return(
        <ul>
            <li className="todo">
                <label>
                    <input type="checkbox"/>
                    <span>1</span>
                    <i className="material-icon red-text">delete</i>
                </label>
            </li>
        </ul>
    )
};
